import styles from "./trendData.module.scss";

const TrendData = () => {
  return <div className={styles.trendWrap}>
    <div className={styles.trendChart}>
      <span>차트가 들어갈 자리입니다.</span>
    </div>
  </div>;
};

export default TrendData;
